import {useState, useEffect} from 'react'
import ExamCard from './ExamCard'
import axios from 'axios'
import { useParams } from 'react-router-dom';


const ListExams = () => {

    const api = "http://localhost:8088/api/v1/examResult/trainee"
    
    const [examResults, setExamResults] = useState([])

    const  params = useParams();

    useEffect(() => {
        listExams()
    }, [])

    const listExams = () => {
        console.log("THE ID USING PARAMS IS: " + params.trainee_id)
        axios.get(api + '/' + params.trainee_id)
                .then(response => {setExamResults(response.data)})
                .catch(error => console.log('unable to load data'))
    }

    return(
      <div>
          <h1> Exam Results </h1>
          {
              examResults.map(
                  examResults => <ExamCard key={examResults.trainee.name} examResults={examResults}/>
              )
          }
         
      </div>
  )


    return(
      <table>
       <thead>
         <tr>
           <td> Name</td> <span />
           <td> Course</td> <span />
           <td> Score</td>
         </tr>
       </thead>
       <tbody>
         {
            examResults.map(
             examResult =>  <tr key= {examResult.trainee.name}>
               <td>{examResult.course.name}</td>
               <td>{examResult.score}</td>
             </tr>
            )
        }  
       </tbody>
      </table>
     )
}

export default ListExams
